import React from 'react'
import classes from './About.module.css';
export const About = () => {
    return(
        <section className={classes.overview}>
          <h2>Need indepth detail about companies ?</h2>
          <p>
            Get your company Specific guide from your Senior By contacting Through
            LinkedIn id
          </p>
      
          <p>All You can do by clicking on companies Linked in side with Linkedin section</p>
        </section>);
      };
